import React from 'react';
import '../css/LoginForm.css';

class LoginForm extends React.Component {

    render() {
        return (
            <div className="FormContainerLogin">
                <form>
                    <ul>
                        <li className="LoginForm">
                            <label for="username">Username: </label>
                            <input type="text" required id="username" name="username" className="LoginForm"/>
                        </li>
                        <li className="LoginForm">
                            <label for="password">Password: </label>
                            <input type="text" required id="password" name="password" className="LoginForm" />
                        </li>
                        <li class="LoginSubmitBtn">
                            <button type="submit" className="Logins">Login </button>
                        </li>
                    </ul>
                </form>
                <div className="RecoverPasswordBtn">Recover Password</div>
            </div>            
        );
    }
}

export default LoginForm;
